    "2016-07-27T23:05:07.299986",nt"name": "lidar-malheur-nwr-3160e",nt"isopen":
    false,nt"url": null,nt"notes": "This project was funded through the Region
    1 Inventory and Monitoring Initiative RFP in 2011. LiDAR has been identified by
    the Malheur Lake Work Group as critical tool for planning, management, and restoration
    across the Harney Basin. In particular, this project focuses on three areas of interest;
    Donner und Blitzen Watershed, Malheur Lake, and the Silvies floodplain. WSI, a Quantum
    Spatial company, has collected Light Detection and Ranging (LiDAR) data for the
    Oregon LiDAR Consortium (OLC) Harney Basin study area. This study area is located
    in southeastern Oregon. The collection of high resolution geographic data is part
    of an ongoing pursuit to amass a library of information accessible to government
    agencies as well as the general public. In October 2014 WSI employed remotesensing
    lasers in order to obtain a total area flown of 405,647 acres. Settings for LiDAR
    data capture produced an average resolution of at least eight pulses per square
    meter. Final products created include RGB extracted LiDAR point cloud data, three
    foot digital elevation models of highest hit and bare earth ground models, hydro-conditioned
    bare earth ground models, and ground density rasters, 1.5 foot intensity rasters,
    study area vector shapes, and corresponding statistical data. Final deliverables
    are projected in Universal Transverse Mercator (UTM) 11 North. Six inch orthophotos
    will be collected in June 2015.",nt"license_title": "License Not Specified",nt"extras":
